INSERT INTO `ims_hyb_yl_hospital` VALUES (2,2,'菏泽市立医院','images/2/2020/09/xnbH0O9JSNG582ac5zYvSBcw28y50H.jpg','18888888888','','','',0,'','','',18,'菏泽市立医院（山东省立医院集团菏泽医院）始建于1946年，是一所集医疗、教学、科研、预防、保健、急救和技术指导于一体的现代化大型综合性三级医院，是山东大学医学院、泰山医学院研究生培养基地、菏泽医学专科学校的附属医院，担负着菏泽市八县两区九百五十万人民及邻近省、市部分群众的医疗保健任务。医院开放床位1300张，年门急诊量70余万人次，年住院病人4.7万余人次、年手术1.2万余人次。现有职工1620人，其中副高级以上专业技术职称人员234人，中级职称553人，博士、硕士研究生220人；有2名专家成为全国专业技术委员会委员、60名专家成为全省专业技术委员会委员，其中3人为全省专业技术委员会副主任委员，有43名专家成为全市专业技术委员会主任委员；有8名专家成为解放军进修学院、山东大学医学院、泰山医学院硕士研究生导师；有11名专家成为菏泽市专业技术拔尖人才；有317名主任、副主任医师被济宁医学院、泰山医学院、菏泽医专等高等院校聘为兼职教授和副教授，享受国务院特殊津贴者2人。医院正在按三甲医院标准，规划建设20万平方米的门、急诊、医技、科研、病房综合大楼，力争用五年的时间医疗用房达到25万平方米，开放床位增加到3000张。医院设有34个临床科室，20个医技科室，23个职能科室。医院现拥有省级医疗质量示范科室1个（血液内科），市级医疗质量示范科室4个（血液内科、消化内科、口腔科、普外二科），优质护理服务示范科室16个，口腔科是国家、省“微笑列车”工程定点科室。 医院开展了多项国内先进水平的医疗技术，如开展的1、冠状动脉造影及支架放置术。2、心脏搭桥术。3、各种消化内镜诊疗技术。4、肠内、外营养技术。5、骨髓移植术、单克隆抗体临床应用。在许多疾病的诊治上达到了国内先进水平，如1、风湿疾病的诊断与治疗研究。2、肿瘤基因诊断及治疗。3、实施腹腔镜结肠癌根治。4、关节、骨创、脊柱外科手术。5、微创泌尿外科。6、大面积烧伤。7、电子鼻咽喉镜下，鼻咽、下咽、喉息肉及良性肿瘤的治疗和精确检查。8、实体肿瘤的治疗。9、难治性贫血、白血病、多发性骨髓瘤。10、神经介入治疗术。11、门静脉高压症及脾脏疾病的治疗。12、髂（肋）骨移植治疗下颌骨肿瘤及缺损。13、头皮冠状切口治疗颌面部复杂骨折。14、微创治疗下颌骨骨折。15、各种乳腺疾病、糖尿病合并症等 。医院现拥国内先进的高端大型诊疗设备，设备总值近2亿元。如美国瓦里安 23EX 直线加速器， 64排螺旋CT、1.5T超导磁共振、全数字化乳腺X光机、高档血管造影系统、DR、CR、DSA、X线刀，各类国内外先进的电子胃肠镜、超声内镜、关节镜、高清腹（胸）腔、脑室镜、输尿管镜、血液透析设备、3D彩色超声仪、全数字化彩超、心脏彩超、全自动五分类血液分析仪、全自动生化分析仪、高级麻醉工作站和一定规模ICU、EICU、CCU、NICU；拥有国际一流净化手术室和标准无菌层流净化病房。医院实施“坚持以病人为中心”全程优质服务，全年无假日应诊。医院紧跟公立医院改革步伐，积极参与其中，扎实开展对口支援基层医疗机构、优质护理服务的示范工程、优化门诊服务流程、实施门诊预约诊疗服务、开展临床路径管理、引进第三方医疗纠纷处理机制等各项工作。创新服务模式取得了良好的成效。连续多年被省、市卫生主管部门评为先进集体、精神文明先进单位。医院现为淮海经济区十佳医院、卫生部国际紧急救援中心定点医院、国家级爱婴医院。目前，医院正以争创三级甲等医院、打造鲁苏豫皖四省交界医疗高地为目标，紧紧围绕“学科上水平，管理上台阶”，全面实施精品战略，坚持科学发展、精品兴院、创新求精和精细管理，不断提升医院诊疗技术和特色，不断强化学科建设和优势，不断提高质量和效益，不断改善基础建设和保障，全面促进医院又好又快发展。',3,'',0,1,'','hezeshili','2021-09-03',1600574167,'qq112313','',0,0,0,'',4,1,0,'','黄龙',0.00,0,0,1,0,'','',''),(6,2,'测试机构','images/2/2020/09/VBBq7PZIkB7fBBKFIPp6qQJIffZPBS.jpg','','','','',0,'','','',16,'',1,'',0,1,'','机构','2024-09-27',1601473238,'12345678','',0,0,0,'',1,1,0,'','王丽',0.00