; microsoft=&quot;&quot; font-size:=&quot;&quot; text-indent:=&quot;&quot; background-color:=&quot;&quot;&gt;幼儿急疹（exanthema subitum，ES）又称&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%A9%B4%E5%84%BF%E7%8E%AB%E7%91%B0%E7%96%B9/8605620&quot; data-lemmaid=&quot;8605620&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, tahoma, &quot; microsoft=&quot;&quot; font-size:=&quot;&quot; text-indent:=&quot;&quot; white-space:=&quot;&quot; background-color:=&quot;&quot;&gt;婴儿玫瑰疹&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, tahoma, &quot; microsoft=&quot;&quot; font-size:=&quot;&quot; text-indent:=&quot;&quot; background-color:=&quot;&quot;&gt;（roseola infantum，RI），是婴幼儿常见的一种急性发热发疹性疾病，由人类疱疹病毒6、7型感染引起。其特点是在发热3～5天后热度突然下降，皮肤出现玫瑰红色的斑丘疹，病情减轻，如无并发症可很快痊愈。&lt;/span&gt;&lt;/p&gt;','&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;感染发病多在2岁以内，尤以1岁以内最多。&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;1.发热&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;潜伏期1～2周，平均10天。多无前驱症状而突然发生高热，体温39℃～40℃以上，高热初期可伴惊厥。患儿除了有食欲缺乏外，一般精神状态无明显改变，但亦有少数患儿有恶心、呕吐、咳嗽、巩膜炎、口周肿胀及血尿、极少数出现嗜睡、惊厥等，咽部和扁桃体轻度充血和头颈部、枕部淋巴结轻度肿大，表现为高热与轻度的症状及体征不相称。&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;2.出疹&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;发热3～5天后，热度突然下降，在24小时内体温降至正常，热退同时或稍后出疹，皮疹为红色斑丘疹，散在，直径2～5毫米不等，压之褪色，很少融合。皮疹通常先发生于面颈部及躯干，以后渐渐蔓延到四肢近端。持续1～2天后皮疹消退，疹退后不留任何痕迹，没有脱屑和色素沉着。部分患儿早期腭垂可出现红斑，皮疹无需特殊处理，可自行消退。&lt;span style=&quot;font-weight: 700;&quot;&gt;&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-weight: 700;&quot;&gt;3.其他症状&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;包括眼睑水肿、前囟隆起、流涕、腹泻、食欲减退等。部分患儿颈部淋巴结肿大。&lt;/div&gt;&lt;div class=&quot;anchor-list &quot; style=&quot;position: relative; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;3&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;sub77692_3&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;检查&quot;&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;para-title level-2&quot; label-module=&quot;para-title&quot; style=&quot;clear: both; zoom: 1; overflow: hidden; border-left: 12px solid rgb(79, 156, 238); line-height: 24px; font-size: 22px; font-family: &quot; microsoft=&quot;&quot; margin:=&quot;&quot; 35px=&quot;&quot; 0px=&quot;&quot; 15px=&quot;&quot; background:=&quot;&quot; position:=&quot;&quot; color:=&quot;&quot; white-space:=&quot;&quot;&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;人类疱疹病毒6型（HHV-6）是主要病因，绝大多数ES由HHV-6B型感染引起，极少由A型感染引起。幼儿急疹及发热性疾病中，B型的感染多见，在免疫抑制病人，两型感染均可见。其他少见的病因有人类疱疹病毒7型（HHV-7）、柯萨奇病毒A和B、埃可病毒、腺病毒和副流感病毒1。&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;HHV-6具有典型的疱疹病毒科病毒的形态特征，病毒颗粒呈圆形，由162个壳粒组成20面体对称的核衣壳，直径90～110nm；外面由皮质粒组成皮质层，厚20～40nm；最外面覆盖一层脂质膜，表面有不规则糖蛋白突起。核心是线状双链DNA缠绕在一核心蛋白周围形成轴丝；成熟释放的病毒颗粒直径180～200nm。&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;HHV是1990年首次从健康成人外周血T淋巴细胞中分离、此后又从慢性疲劳综合征患者体内分离出该病毒。病毒颗粒直径约200nm。HHV-7有囊膜。与HHV-6、CMV同属于β-疱疹病毒科。&lt;/div&gt;&lt;div class=&quot;anchor-list &quot; style=&quot;position: relative; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;2&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;sub77692_2&quot;&gt;&lt;/a&gt;&lt;/div&gt;','&lt;p&gt;&lt;br/&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;2岁以下的婴幼儿突然高热，无其他系统症状，热退时出现皮疹，应该考虑此病。本病需要与肺炎球菌脓毒血症及麻疹、风疹和川崎病等进行鉴别。与风疹鉴别较为重要，因两者皮疹相似，但风疹患儿热度不高，发热的同时出现皮疹，耳后和枕部淋巴结肿大更明显。而幼儿急疹是高热3～5天后热退疹出。&lt;/span&gt;&lt;/p&gt;&lt;div class=&quot;anchor-list &quot; style=&quot;position: relative; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;3&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;sub77692_3&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;检查&quot;&gt;&lt;/a&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;本病应着重一般处理，加强护理，主要是对症处理。轻型患儿可卧床休息，给予适量水分和营养丰富易消化饮食。高热时可给予物理降温或小量退热剂，哭闹烦躁试用镇静剂；惊厥则及时止惊。退热剂及对症治疗。但对免疫缺陷的婴幼儿或者严重的病例，则需抗病毒治疗，目前尚无十分肯定的抗病毒药。&lt;/span&gt;&lt;/p&gt;','','&lt;div class=&quot;para&quot; label-module=&quot;para&quot; style=&quot;font-size: 14px; word-wrap: break-word; color: rgb(51, 51, 51); margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;本病预后良好，严重的并发症很少发生，有报道患儿可出现HHV-6脑病、肝炎、嗜血细胞综合征等。&lt;/div&gt;&lt;div class=&quot;anchor-list &quot; style=&quot;position: relative; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;7&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;sub77692_7&quot;&gt;&lt;/a&gt;&lt;a style=&quot;color: rgb(19, 110, 194); position: absolute; top: -50px;&quot; name=&quot;预防&quot;&gt;&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;para-title level-2&quot; label-module=&quot;para-title&quot; style=&quot;clear: both; zoom: 1; overflow: hidden; border-left: 12px solid rgb(79, 156, 238); line-height: 24px; font-size: 22px; font-family: &quot; microsoft=&quot;&quot; margin:=&quot;&quot; 35px=&quot;&quot; 0px=&quot;&quot; 15px=&quot;&quot; background:=&quot;&quot; position:=&quot;&quot; color:=&quot;&quot; white-space:=&quot;&quot;&gt;&lt;/div&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;','o9W585aPJ1CMzYiM74A58NAQmwbk',30,70,0,1594569600,1,1,0,1,1,1,0,'','','[\"images\\/39\\/2020\\/07\\/ch0nNgParVN700UhfLVb01Thbyvhnz.jpeg\"]',73,'','../attachment/hyb_yl/1595497729.png',NULL),(118,39,0,'痱子','','','','','','','','','',0,0,0,1594638770,1,0,0,0,0,0,0,'热门','','',0,NULL,NULL,NULL),(119,39,0,'小儿感冒','','','','','','','','','',0,0,0,1594638770,1,0,0,0,0,0,0,'热门','','',0,NULL,NULL,NULL),(120,39,0,'贫血','','','','','','','','','',0,0,0,1594638770,1,0,0,0,0,0,0,'热门','','',0,NULL,NULL,NULL),(121,39,0,'小儿腹泻','','','','','','','','','',0,0,0,1594638770,1,0